import React, { Component } from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';
import './Feed.css';
import Filter from './FIlter';

class Feed extends Component {
    constructor(props){
        super(props)
        this.list = {};
        this.state = {
            filters: []
        }
    }
    render() {
        return (
            <>
                <div className="sidebar">
                    <Filter name="Startup" type="checkbox"></Filter>
                    <Filter name="Investor" type="checkbox"></Filter>
                    <p className="Filter-text">Area of Interest</p>
                    <Filter name="Service Based" type="checkbox"></Filter>
                    <Filter name="Product Based" type="checkbox"></Filter>
                    <Filter name="Ed-tech" type="checkbox"></Filter>
                    <Filter name="House Hold" type="checkbox"></Filter>
                    <Filter name="IOT" type="checkbox"></Filter>
                    <Filter name="Healthcare" type="checkbox"></Filter>
                </div>
                <div className="main"></div>
            </>
        )
    }
}

export default Feed
